      <h1>Test for Corona</h1>
      <p>Answer the question below.</p>
      <br/>
      <Evaluate/>
    </div>
  </Layout>
);

Test.getInitialProps = async function() {
  const res = await fetch('https://covidtracking.com/api/v1/states/nc/current.json');
  
  const data = await res.json();

  console.log("in the testing page")
  console.log("North Carolina Corona Data")
  // console.log(data);
  return {
      case: data
  };
}

export default Test;
